    "text" : "Ruby 2.6 will have \"endless ranges.\"\n\nary[1..]   # identical to ary[1..-1]\n(1..).each \u007B|index| ... \u007D   # infinite loop from index 1\nhttps:\/\/t.co\/rqN38zQafa(1..) \u007B|elem, index| ... \u007D   # ary.each.with_index(1) \u007B \u007D\n\nSee https:\/\/t.co\/zecQl4RkxD in detail.",
